import React from 'react';
import Shop from './Shop';
import {Routes, Route, useNavigate, Navigate, History, unstable_HistoryRouter} from 'react-router-dom';
import { FontAwesomeIcon, } from '@fortawesome/react-fontawesome';
import {faShoppingCart} from '@fortawesome/fontawesome-free-solid';
import Logo from './Logo';
import Contact from './Contact';

let history = unstable_HistoryRouter();
const goToPreviousPath = () => {
    history.goBack()
}
export default function Navbar() {
    return (
        <nav>
            <Logo />
            <Shop />
            <a href='/home/Contact' onClick={() => {goToPreviousPath}}>
            <div className='options'>CONTACT</div></a>
            <div className='options'>ACCOUNT</div>
            <div className='options'>LOGIN</div>
            <FontAwesomeIcon icon={faShoppingCart}/>
        </nav>
        
    )
}
